import React from 'react';


export  class Postview extends React.Component<any> {
    render(){
        return(
            <>
            <div key={Math.floor(Math.random() * 10)} className="box">
            <div className="boxrow">created:  {this.props.dateSubmitted}</div>  
          <span>author:  {this.props.author}</span>  
          <span>postTitle:  {this.props.postTitle}</span>  
          <span>postDescription: {this.props.postDescription}</span>  
          <span>status: {this.props.status}</span>  
          <span>resolver: {this.props.resolver}</span>  
          </div>
            </>
        )
    }
}
